import React from "react";
import Icon from "../imgs/weather-icons/cloudy.png";

const MainBanner = () => {
    return (
        <div className="mainBanner">
            <div className="mainBanner-content__left">
                <h1>New Cairo</h1>
                <h5>Friday 20, 2020</h5>
                <div>
                    <img src={Icon} />
                </div>
                <h3>Cloudy</h3>
            </div>
            <div className="mainBanner-content__right">
                <h2>
                    72°
                </h2>
                <p>81°/63°</p>
                <p>Cloudy throughout the day</p>
            </div>
        </div>
    );
};
export default MainBanner;
